                            About me
                        </a>
                    </li>
                    <li>
                        <span>
                            Contact
                        </span>
                    </li>
                    {
                        categories.map((category) => (
                            <li className={`mx-1 ${currentCategory.name === category.name && 'navActive'
                                }`} key={category.name}>
                                <span onClick={() => { setCurrentCategory(category) }}>
                                    {capitalizeFirstLetter(category.name)}
                                </span>
                            </li>
                        ))
                    }
                </ul>
            </nav>
        </header >
    );
}

export default Nav;
